/////////////////////////////////////////////////////////////////
// Expand Product for Promo Links
////////////////////////////////////////////////////////////////
// Javascript to enable link to tab
		var hash = document.location.hash;
		var $theHash = $('a[href="'+ hash +'"]');
		var target = $theHash.attr('data-target');
		if (hash) {
		    $(target).collapse('show')
		    //console.log($theHash.children('span'))
		    $theHash.children('span').removeClass('glyphicon-plus-sign')
			$theHash.children('span').addClass('glyphicon-minus-sign');
		}
/////////////////////////////////////////////////////////////////
// Jacklin Species Maps JS
////////////////////////////////////////////////////////////////
		$('.specMapLink').click(function() {
			var theLink = $(this).attr('data-tab-target');
			var theHREFLink = "#link_" + theLink;
			var theDIVLink = "#" + theLink;
			//console.log($(theHREFLink).parent());
			
			$(theHREFLink).parent().attr('class','active');
			$(theDIVLink).addClass('active');
		});
		$('#zonemaps').on('hidden.bs.modal', function (e) {
			//console.log('hidden');
		  	var $tab = $('.nav.nav-tabs li');
			$tab.each(function() {
				$(this).removeClass('active');
			});
			
			var $div = $('.tab-pane');
			$div.each(function() {
				$(this).removeClass('active');	
			});
		});
/////////////////////////////////////////////////////////////////
// Form Validation
////////////////////////////////////////////////////////////////
		$('.theForm').validate();

/////////////////////////////////////////////////////////////////
// Customer Service Maps JS
////////////////////////////////////////////////////////////////
		$('.mapDetail').hide();
		$('#supportTeam').hide();
		$('area').click(function() {
			//event.preventDefault();
			event.preventDefault ? event.preventDefault() : event.returnValue = false;
			var theTarget = $(this).attr('target');
			var theCSTarget = $(this).attr('cs-target');
			$('#cs1').hide();
			$('#cs2').hide();
			$('#supportTeam').show();
			$(theCSTarget).show();
			
			$('.mapDetail').hide();
			$(theTarget).fadeIn();
		});
/////////////////////////////////////////////////////////////////
// Expand/Collapse Icons for Products
